import { FormControl, InputLabel, Select, MenuItem } from "@mui/material"

const Dropdown = ({
    id,
    value,
    handleChange,
    name,
    label,
    options,
    ...props
}) => {
    return (
        <FormControl>
            <InputLabel id={id}>{label}</InputLabel>
            <Select>
                <MenuItem>yolo</MenuItem>
              
            </Select>
        </FormControl>
    )
}

export default Dropdown
